#include <iostream>
#include <fstream>
#include <vector>
#include <algorithm>

int main() {
    std::ifstream input("cod.in");
    std::ofstream output("cod.out");

    int n;
    input >> n;

    std::vector<int> count(100, 0);
    for (int i = 0; i < n; ++i) {
        int number;
        input >> number;
        count[number]++;
    }

    std::string result;
    for (int i = 0; i < 100; ++i) {
        if (count[i] % 2 != 0) {
            result += std::to_string(i);
        }
    }

    output << result;
    return 0;
}
